    false,nt"url": null,nt"notes": "This tabular data set represents the estimated
    area of land use and land cover from the National Land Cover Dataset 2001 (LaMotte,
    2008), compiled for every MRB_E2RF1 catchment of the Major River Basins (MRBs, Crawford
    and others, 2006). The source data set represents land use and land cover for the
    conterminous United States for 2001. The National Land Cover Data Set for 2001 was
    produced through a cooperative project conducted by the Multi-Resolution Land Characteristics
    (MRLC) Consortium. The MRLC Consortium is a partnership of Federal agencies (http://www.mrlc.gov),
    consisting of the U.S. Geological Survey (USGS), the National Oceanic and Atmospheric
    Administration (NOAA), the U.S. Environmental Protection Agency (USEPA), the U.S.
    Department of Agriculture (USDA), the U.S. Forest Service (USFS), the National Park
    Service (NPS), the U.S. Fish and Wildlife Service (USFWS), the Bureau of Land Management
    (BLM), and the USDA Natural Resources Conservation Service (NRCS). The MRB_E2RF1
    catchments are based on a modified version of the U.S. Environmental Protection
    Agency's (USEPA) ERF1_2 and include enhancements to support national and regional-scale
    surface-water quality modeling (Nolan and others, 2002; Brakebill and others, 2011).
    Data were compiled for every MRB_E2RF1 catchment for the conterminous United States
    covering the South Atlantic-Gulf and Tennessee (MRB2), the Great Lakes, Ohio, Upper
    Mississippi, and Souris-Red-Rainy (MRB3), the Missouri (MRB4), the Lower Mississippi,
    Arkansas-White-Red, and Texas-Gulf (MRB5) and the Pacific Northwest (MRB7) river
    basins.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
